def getdigit(instruction, digit, keypad, keypadwidth):
	for step in instruction:
		curdigit = keypad[digit]
		if step == "U":
			nextdigit = digit - keypadwidth
		elif step == "R":
			nextdigit = digit + 1
		elif step == "D":
			nextdigit = digit + keypadwidth
		else:
			nextdigit = digit -1
		if keypad[nextdigit] != "#":
			digit = nextdigit
	return(digit)

instructions = ["", "", "", "", ""]

keypad = "##########1#####234###56789###ABC#####D##########"

digit = keypad.index("5")

for instruction in instructions:
	digit = getdigit(instruction, digit, keypad, 7)
	print(keypad[digit])
